import React, { useState, useRef } from "react";
import { useNavigate } from "react-router-dom";
import AboutModal from "./AboutModel";
import {
  MapContainer,
  TileLayer,
  LayersControl,
} from "react-leaflet";
import "leaflet/dist/leaflet.css";

function HomePage() {
  const [search, setSearch] = useState("");
  const [showModal, setShowModal] = useState(false);
  const mapRef = useRef(null);
  const navigate = useNavigate();

  const handleSearch = () => {
    if (search.trim()) navigate(`/map?query=${search}`);
  };

  const scrollToMap = () => {
    if (mapRef.current) {
      mapRef.current.scrollIntoView({ behavior: "smooth" });
    }
  };

  return (
    <div className="bg-gray-100">
      {/* Top Section */}
      <div className="h-screen flex flex-col items-center justify-center relative">
        <button
          className="absolute top-4 right-4 px-4 py-2 bg-blue-600 text-white rounded"
          onClick={() => setShowModal(true)}
        >
          About Us
        </button>

        <img
          src="/geojena.jpg"
          alt="GeoJena Logo"
          className="h-24 mb-6 object-contain"
        />

        <div className="flex gap-2">
          <input
            type="text"
            placeholder="Enter District or State"
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="px-4 py-2 border border-gray-300 rounded w-80"
          />
          <button
            onClick={handleSearch}
            className="px-4 py-2 bg-green-600 text-white rounded"
          >
            Search
          </button>
        </div>

        <button
          onClick={scrollToMap}
          className="mt-8 text-blue-600 underline"
        >
          ↓ Scroll down to view map
        </button>

        {showModal && <AboutModal onClose={() => setShowModal(false)} />}
      </div>

      {/* Map Section */}
      <div ref={mapRef} className="h-screen flex items-center justify-center">
        <MapContainer
          center={[20.5937, 78.9629]} // India center
          zoom={6}
          style={{ height: "80vh", width: "90%" }}
        >
                  <LayersControl position="topright">
          {/* Default Street Map */}
          <LayersControl.BaseLayer checked name="Street Map">
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution="&copy; OpenStreetMap contributors"
            />
          </LayersControl.BaseLayer>

          {/* Satellite + Roads + Labels */}
          <LayersControl.BaseLayer name="Satellite + Roads/Labels">
            <>
              {/* Satellite imagery */}
              <TileLayer
                url="https://services.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}"
                attribution="&copy; Esri, Earthstar Geographics"
              />
              {/* Roads */}
              <TileLayer
                url="https://services.arcgisonline.com/ArcGIS/rest/services/Reference/World_Transportation/MapServer/tile/{z}/{y}/{x}"
                attribution="&copy; Esri"
              />
              {/* Labels */}
              <TileLayer
                url="https://services.arcgisonline.com/ArcGIS/rest/services/Reference/World_Boundaries_and_Places/MapServer/tile/{z}/{y}/{x}"
                attribution="&copy; Esri"
              />
            </>
          </LayersControl.BaseLayer>
        </LayersControl>
        </MapContainer>
      </div>
    </div>
  );
}

export default HomePage;
